When Bowie reinvents himself it goes much further than a costume change. The band changes, the arrangements change, the stage show changes, the man even changes his vocal delivery to fit the new style. In the case of the Soul Tour, Bowie had stopped down for three weeks in the midst of the Diamond Dogs tour to completely rebrand his show to focus on elements of his next record ‚ÄúYoung Americans.‚Äù The rock band and huge stage set are replaced with a saxophone player and several background singers, including a young Luther Vandross and Bowie‚Äôs then girlfriend Ava Cherry. The result is an absolutely shocking departure from the band we all loved on ‚ÄúCracked Actor‚Äù recorded only a few months prior. Bowie and his band manage to seamlessly blend rock, soul and disco into a musical whirlwind to create one of the most storied and legendary tours of his career.
This pressing limited to 5000 copies is the first ever official release of this widely bootlegged tour. All of the album was recorded on October 20th 1974 in Detroit with exception of the encore which is pulled from the November 30th Nashville show. This is by no means an audiophile release, but the content presented here will outweigh any gripe you may have. 
